import React from 'react'
import {
  InnerBox,
  InnerBoxContainer,
  InnerBoxHeader,
  InnerBoxTitle,
  MainContainer,
  Margin36,
} from '../../../../component/styledComponent'
import { InfoBox } from '../../../../component/box/info'
import { usePage } from '../../../../hooks/usePage'
import { Page } from '../../../../component/page'

export const InnerSchedulePage = () => {
  const {
    pageList,
    currentPage,
    maxPage,
    getPrevPage,
    getNextPage,
    clickPage,
    setMaxPage,
  } = usePage()

  const ScheduleBox = index => {
    return <InnerBox>{index}</InnerBox>
  }
  return (
    <MainContainer>
      <InnerBoxHeader>
        <InnerBoxTitle>예배 일정 목록</InnerBoxTitle>
      </InnerBoxHeader>
      <InnerBoxContainer>
        <Margin36 />
        <InfoBox text="박스를 클릭하면 수정 및 삭제를 할 수 있어요." />
        <Margin36 />
        <ScheduleBox index={0} />
        <Page
          pageList={pageList}
          currentPage={currentPage}
          getPrevPage={getPrevPage}
          getNextPage={getNextPage}
          clickPage={clickPage}
          lastPage={maxPage}
        />
      </InnerBoxContainer>
    </MainContainer>
  )
}
